	/**
	 *
	 * @var Customweb_Payment_Authorization_ITransactionContext
	 */
	private $orderContext;

	protected function getPaymentInformationMap(){
		return self::$informationMap;
	}

	public function __construct(Customweb_Payment_Authorization_IPaymentMethod $method, Customweb_Payment_Authorization_IOrderContext $orderContext = null){
		parent::__construct($method);
		if ($orderContext != null) {
			$this->setOrderContext($orderContext);
		}
	}

	/**
	 * Returns the Saferpay id for this payment method.
	 *
	 * @return string ID of the payment method.
	 */
	public function getPaymentId(){
		$params = $this->getPaymentMethodParameters();
		return $params['id'];
	}

	public function getPaymentIdParameter(){
		return array(
			'PAYMENTMETHODS' => $this->getPaymentId() 
		);
	}

	/**
	 * Is Alias manager supported for the payment method,
	 *
	 * @return True if alias manager is supported
	 */
	public function isAliasManagerSupported(){
		$features = $this->getNotSupportedFeatures();
		return !in_array('AliasManager', $features);
	}

	/**
	 *
	 * @return Customweb_Payment_Authorization_ITransactionContext
	 */
	public function getOrderContext(){
		return $this->orderContext;
	}

	public function setOrderContext(Customweb_Payment_Authorization_IOrderContext $orderContext){
		$this->orderContext = $orderContext;
	}

	/**
	 * Returns the visible form fields that are needed for hidden and
	 * server authorization.
	 *
	 * @return Customweb_Form_IElement[] List of visible form fields for this payment method.
	 */
	abstract public function getVisibleFormFields(Customweb_Payment_Authorization_IOrderContext $orderContext, $aliasTransaction, $failedTransaction, $isMoto = false);

	/**
	 * Returns the hidden form fields that are needed for hidden and
	 * server authorization.
	 *
	 * @return array[] Hidden form fields
	 */
	abstract public function getHiddenFormFields();

	/**
	 * Returns true if the payment method generally supports 3D secure verification.
	 *
	 * @return True, if the payment method supports 3D secure
	 */
	abstract public function is3DSecureSupported();

	/**
	 * Returns additional parameters that are required specifically for this payment method
	 * for the payment page "pay init" request.
	 *
	 * @return array Additional parameters
	 */
	abstract public function getAdditionalPaymentPageParameters();

	/**
	 * Returns additional parameters that are required specifically for this payment method
	 * for the capture request.
	 *
	 * @return array Additional parameters
	 */
	abstract public function getAdditionalCaptureParameters();

	abstract public function isEciMeaningless();

	/**
	 * Returns the need authorization parameters for this payment method.
	 * 
	 * @return array The authorization parameters.
	 */
	public function getAuthorizationParameters(Customweb_Saferpay_Authorization_Transaction $transaction, array $parameters){
		return array();
	}

	/**
	 * Maps a given payment ID to a machine name.
	 *
	 * @param string $id
	 * @throws Exception
	 * @return string
	 */
	public static function getPaymentMethodMachineNameByPaymentMethodId($id){
		if (empty($id)) {
			throw new Exception("The given payment method id is empty.");
		}
		
		foreach (self::$informationMap as $item) {
			if (isset($item['parameters']['id']) && $item['parameters']['id'] == $id) {
				return $item['machine_name'];
			}
		}
		
		throw new Exception(Customweb_I18n_Translation::__("Unable to resolve payment method id '@id' to a payment method name.", array(
			'@id' => $id 
		)));
	}

	/**
	 * Resolve a given card type id to a payment method.
	 *
	 * @param string $id
	 * @throws Exception
	 * @return string
	 */
	public static function getPaymentMethodMachineNameByCardTypeId($id){
		if (empty($id)) {
			throw new Exception("The given card type id is empty.");
		}
		
		$ids = self::$cardTypeIds;
		if (isset($ids[$id])) {
			return $ids[$id];
		}
		
		throw new Exception(Customweb_I18n_Translation::__("Unable to resolve card type id '@id' to a payment method name.", array(
			'@id' => $id 
		)));
	}
	
	public function extractPaymentInformation(array $parameters){
		return array();
	}
}
